import{_ as e,c as i,o as a,d as t}from"./app.baa7ecd7.js";const u=JSON.parse('{"title":"","description":"","frontmatter":{},"headers":[],"relativePath":"lifes/2023-01-09.md","lastUpdated":1676093087000}'),r={name:"lifes/2023-01-09.md"},c=t('<h2 id="_2023年直接开摆" tabindex="-1">2023年直接开摆? <a class="header-anchor" href="#_2023年直接开摆" aria-hidden="true">#</a></h2><p>大家好，我是元宝，好长一段时间没有写文章了，说来有点小惭愧🥹，前段时间因为各种屁事的推脱，导致我水了不知道多少个星期的推文。 因为今日刚阳康，气色还不错，就去朋友圈臭美了一波<img src="https://mmbiz.qpic.cn/mmbiz_png/r06f09AAJObu1Eyx2YicuXUBJ50EPFJSVqQyXUS8RDsUhGIL8haOQDOJ3AlJunBcrEqKGib1YV7zIP84CWVwMXOQ/0?wx_fmt=png" alt=""> 然后就是趁今日美滋滋的心情以及不断被我舍友的各种催促下,我终于打开了那快要生锈的编辑器了🥹<img src="https://mmbiz.qpic.cn/mmbiz_jpg/r06f09AAJObu1Eyx2YicuXUBJ50EPFJSVH3efb3BeE0YH3TU6C1uY4vqcNLKSoKLvw5kq6TB0lgAcvNftnLaqWg/0?wx_fmt=jpeg" alt=""></p><p>那今日推文我就来讲一下距离上次发文<strong>到现在都干了些啥</strong>，<strong>现在在做什么</strong>以及对于我来说<strong>极为重要的2023年</strong>内我应该有着怎么样的<strong>计划</strong>！</p><h2 id="md-bao-开始到放弃" tabindex="-1">MD Bao，开始到放弃 <a class="header-anchor" href="#md-bao-开始到放弃" aria-hidden="true">#</a></h2><p>由于前段时间热爱写文章，于是我也想自己开发一个MD文档编辑器的网站，方便自己管理自己写的文章，也有一个大胆的想法，想通过这个网站的登录功能来为我的公众号引流，但事与愿违，网站算是开发好了<img src="https://mmbiz.qpic.cn/mmbiz_jpg/r06f09AAJObu1Eyx2YicuXUBJ50EPFJSVibuXzvoFFLLzibacevvlE5NkMO2RpiaLpoDkhSmRKYjcZBfhKUHwdI60A/0?wx_fmt=jpeg" alt="">但是真正部署上线的时候却出了问题，要想接收微信服务器的消息推送，我的订阅号必须通过那昂贵的微信认证费用，于是我就果断的放弃了。但言归正传，这不是重点，重点是这个项目让我成长了什么。这个项目是我用<code>vue3</code>+<code>ts</code>独立开发的第一个完整项目,里面用到了许多如今热门的技术，这里我就把我用到的技术罗列出来，后面等我闲下来把这个项目开源，那死肥猪舍友就等着白嫖吧🥹，网站现在的地址为<code>https://mdbao.workdomain.cloud</code></p><ul><li>前端 <ul><li>vue3</li><li>typescript</li><li>tailwindcss</li><li>vite</li></ul></li><li>后端 <ul><li>node</li><li>express</li><li>mongodb + redis</li></ul></li><li>pnpm项目管理</li><li>docker + pm2 + nginx 网站部署</li></ul><h2 id="mac-studio-造梦引擎" tabindex="-1">Mac Studio 造梦引擎 <a class="header-anchor" href="#mac-studio-造梦引擎" aria-hidden="true">#</a></h2><p>前段时间还是圆了2022年最后一个梦，买了苹果重量级主机<code>Mac Studio</code> <code>32运存</code> <code>512内存</code>的<code>丐版</code>,虽然为丐版，但是性能真的是<code>怪兽级别</code>的，毫不夸张的说是办公人首选的生产力设备，为了在实现梦想的道路上能有更好的体验感，我还是很舍得花钱在自己身上，不断的提升自我。其次也是出于我对苹果的热爱，竟然在2022年内花了足足<strong>3.5w</strong>在苹果设备上，这是我没想到的，下次不敢了🥹 <img src="https://mmbiz.qpic.cn/mmbiz_jpg/r06f09AAJObu1Eyx2YicuXUBJ50EPFJSVrlU6LZ5UmQGe2zprPBsbIUvUSEd9rlcIvsK5axe72TxErwZGHICnug/0?wx_fmt=jpeg" alt=""></p><h2 id="毕设中期答辩" tabindex="-1">毕设中期答辩 <a class="header-anchor" href="#毕设中期答辩" aria-hidden="true">#</a></h2><p>毕业设计中期答辩在12月中旬的时候检查，记得那时候紧张，因为我那毕设老早就做好了，而且用到了微服务架构，老长一段时间没看java的我于是开始慌了起来，代码都有点生疏了，生怕自己答辩的时候出错。</p><h2 id="做一个点餐小程序" tabindex="-1">做一个点餐小程序 <a class="header-anchor" href="#做一个点餐小程序" aria-hidden="true">#</a></h2><p>最近也是闲下来了，然后我哥也是再三的催促我上次答应帮他做的小程序什么时候可以做好，因为他上一年开了一家咖啡馆，被美团饿了么等外卖平台抽水抽太多了，所以也想拥有一个属于自己门店的小程序。害，谁让他弟是个程序员呢🥹</p><h2 id="_2023年规划" tabindex="-1">2023年规划 <a class="header-anchor" href="#_2023年规划" aria-hidden="true">#</a></h2><p>2023年是我成长过程中的一个<strong>里程碑</strong>，大学4年也即将挥之而去，即将步入真正社会的我，也提前的适应着社会的考验。很感激这4年努力的自己，让我在这社会有立足的根本，也非常感激父母这4年在学习生活上的资助。2023年事业上一定要顺风顺水，继续不断的学习，向尤大学习🥹，希望在未来我也能即时的<strong>抓住机遇</strong>，自己写一个开源的前端框架来应对<strong>机遇所带来的挑战</strong>，梦想还是要有的，万一实现了呢😎</p><p>今天的推文就到此结束叭，现在是凌晨12:30，我竟然熬夜写推文而不是写代码，所以我这算不务正业吗🥹，886～～<img src="https://mmbiz.qpic.cn/mmbiz_jpg/r06f09AAJObu1Eyx2YicuXUBJ50EPFJSVXdDl7ic6yqOE6tO0COdkzHibibEszIPb3B8UFHCN5aISuTJ6avkaXNdHQ/0?wx_fmt=jpeg" alt=""></p>',15),d=[c];function o(s,n,l,p,h,m){return a(),i("div",null,d)}const g=e(r,[["render",o]]);export{u as __pageData,g as default};
